INSERT INTO `slorg_admin` (`id`, `texto1`, `texto2`, `texto3`, `texto_inicio1`, `texto_inicio2`, `p61`, `p62`, `p63`) VALUES
(1, '', 'CUESTIONARIO DE SATISFACCIONLABORAL.ORG', '<p>Estimados funcionarios (as),</p><p>El Estudio de Satisfacción Laboral (ESL) busca determinar las variables que pueden incidir positiva y/o negativamente sobre la percepción que tienen los funcionarios sobre la organización que conforman, mediante la generación de un Balance Social Laboral.</p><p>Antes de Responder el Cuestionario debe considerar que:<br/>El éxito de este Estudio depende de su colaboración y sinceridad al responder. Además, le aseguramos que la información entregada por usted será CONFIDENCIAL.</p><p>INSTRUCCIONES:</p><p>A continuación encontrará una serie de PROPOSICIONES, frente a cada una de ellas usted debe seleccionar la alternativa que mejor lo represente.</p><p>Es importante, que usted responda TODAS las PROPOSICIONES, de lo contrario su Cuestionario no podrá ser considerado para el análisis. Cabe señalar que no existen respuestas buenas o malas, correctas o incorrectas, solo nos interesa su OPINIÓN.</p><p>Para focalizar los resultados y elaborar Planes de Acción más efectivos, es necesario diferenciar la información recogida en el Cuestionario, para tales efectos, le agradecemos seleccionar la información que corresponda a sus datos:</p>', 'BIENVENIDOS A SASTISFACCIONLABORAL.ORG', 'Aquí encontrará toda la Información del Proyecto y podrá ingresar a la ENCUESTA DE CLIMA.  Lo invitamos a visitarnos y a conocer el Proyecto.', 1, 0, 0);
